import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
    const [usuario, setUsuario] = useState('');
    const [password, setPassword] = useState('');
    const [primerNombre, setPrimerNombre] = useState('');
    const [segundoNombre, setSegundoNombre] = useState('');
    const [primerApellido, setPrimerApellido] = useState('');
    const [segundoApellido, setSegundoApellido] = useState('');
    const [email, setEmail] = useState('');
    const [fechaNacimiento, setFechaNacimiento] = useState('');
    const [error, setError] = useState('');
    const navigate = useNavigate();

    const handleRegister = async (e) => {
        e.preventDefault();
        const newUser = {
            usuario,
            password,
            primerNombre,
            segundoNombre,
            primerApellido,
            segundoApellido,
            email,
            fechaNacimiento,
        };

        try {
            const response = await fetch('http://localhost:9001/Laboratorio1/register', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(newUser),
            });

            if (response.ok) {
                Swal.fire('¡Registro exitoso!', 'Tu cuenta ha sido creada.', 'success').then(() => {
                    navigate('/login');
                });
            } else {
                const errorData = await response.json();
                setError(errorData.message || 'Error al registrar el usuario.');
                Swal.fire('Error', errorData.message || 'Error al registrar el usuario.', 'error');
            }
        } catch (error) {
            console.error('Error en la solicitud:', error);
            setError('Error en la conexión al servidor.');
            Swal.fire('Error', 'Error en la conexión al servidor.', 'error');
        }
    };

    return (
        <div className="container-fluid" style={{ 
            background: 'linear-gradient(to right, #c1d3ff, #c9b1ff)', 
            minHeight: '100vh', 
            padding: '20px' 
        }}>
            <h1 className="mb-4">Registro de Usuario</h1>
            {error && <div className="alert alert-danger">{error}</div>}

            <form onSubmit={handleRegister} className="bg-light p-4 rounded">
                <div className="mb-3">
                    <label htmlFor="usuario" className="form-label">Usuario</label>
                    <input
                        type="text"
                        id="usuario"
                        className="form-control"
                        value={usuario}
                        onChange={(e) => setUsuario(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="password" className="form-label">Contraseña</label>
                    <input
                        type="password"
                        id="password"
                        className="form-control"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="primerNombre" className="form-label">Primer Nombre</label>
                    <input
                        type="text"
                        id="primerNombre"
                        className="form-control"
                        value={primerNombre}
                        onChange={(e) => setPrimerNombre(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="segundoNombre" className="form-label">Segundo Nombre</label>
                    <input
                        type="text"
                        id="segundoNombre"
                        className="form-control"
                        value={segundoNombre}
                        onChange={(e) => setSegundoNombre(e.target.value)}
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="primerApellido" className="form-label">Primer Apellido</label>
                    <input
                        type="text"
                        id="primerApellido"
                        className="form-control"
                        value={primerApellido}
                        onChange={(e) => setPrimerApellido(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="segundoApellido" className="form-label">Segundo Apellido</label>
                    <input
                        type="text"
                        id="segundoApellido"
                        className="form-control"
                        value={segundoApellido}
                        onChange={(e) => setSegundoApellido(e.target.value)}
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="email" className="form-label">Email</label>
                    <input
                        type="email"
                        id="email"
                        className="form-control"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="fechaNacimiento" className="form-label">Fecha de Nacimiento</label>
                    <input
                        type="date"
                        id="fechaNacimiento"
                        className="form-control"
                        value={fechaNacimiento}
                        onChange={(e) => setFechaNacimiento(e.target.value)}
                        required
                    />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>

            <div className="mt-3">
                <Link to="/login" className="btn btn-secondary">Volver a Iniciar Sesión</Link>
            </div>
        </div>
    );
};

export default Register;
